export const msalConfig = {
  auth: {
    clientId: "14b86200-df2c-43c0-acad-053f6c02d59e", // senin client ID
    authority: "https://login.microsoftonline.com/552a6af7-31b4-4de6-a7d7-cf20278bde03", // tenant ID doğru
    redirectUri: "https://localhost:000", // uygulaman nerede çalışıyorsa O
  },
  cache: {
    cacheLocation: "localStorage",
    storeAuthStateInCookie: true,
  },
};
